CREATE PROCEDURE CalculateFactorial(IN n INT, OUT result INT)
BEGIN
    DECLARE i INT DEFAULT 1;      -- 
    DECLARE factorial INT DEFAULT 1;  -- 

    -- 
    WHILE i <= n DO
        SET factorial = factorial * i;
        SET i = i + 1;
    END WHILE;

    -- 
    SET result = factorial;
END //

DELIMITER ;

