CREATE FUNCTION calculate_bonus(salary DECIMAL(10, 2)) RETURNS DECIMAL(10, 2)
BEGIN
    DECLARE bonus DECIMAL(10, 2);
    SET bonus = salary * 0.10;
    RETURN bonus;
END //

